import React from "react";
import { AppBar, Avatar, Button, Link, Toolbar, Typography } from "@material-ui/core";
import memories from "../../images/memories.png";
import Auth from "../Auth/Auth";
import useStyles from "../Navbar/styles";
const Navbar = () => {


  const classes = useStyles();

  const user = null;


  return (
    <AppBar className={classes.appBar} position="static" color="inheit">
      <div className={classes.brandContainer}>
        <Typography component={Link} to="/" className={classes.heading} variant="h3" align="center">
          Memories
        </Typography>
        <img
          className={classes.image}
          src={memories}
          alt="memories"
          height="40"
        />
      </div>
      <Toolbar>
        {user ?(
          <div className={classes.profile}>
            <Avatar className={classes.purple} alt = {user.result.name} src={user.result.imaggeUrl}>{user.result.name.charAt(0)}</Avatar>
            <Typography className={classes.userName} variant="h6">{user.result.name}</Typography>
            <Button variant="contained" className={classes.logout} color="seconday" >Logout</Button>
          </div>
        ):(
          
          <Button variant="contained" color="primary" onClick={()=>{<Auth/>}}>Sign In</Button>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
